import React from "react";
import GitHubIcon from '@material-ui/icons/GitHub';
import IconButton from '@material-ui/core/IconButton';
import { withRouter } from "react-router-dom";

class Home extends React.Component {
    // toGitHub() {
    //   this.props.history.push('https://github.com/cindydhy');
    // }

    render() {
        const useStyles = {
            title: {
                padding: "10px",
                fontFamily: "Merriweather",
                textAlign: "center",
                textTransform: "uppercase",
                color: "#484D51",
                fontSize: "35px",
                position: "absolute",
                left: "38%",
                top: "30%",
            },
            subheadings: {
                position: "absolute",
                left: "37%",
                top: "43%",
                color: "#484D51",
                fontFamily: "B612",
            },
            icons: {
              position: "absolute",
              left: "38%",
              top: "43%",
              color: "#484D51",
              fontFamily: "B612",
          },
        };
      return (
        <div>
            <h1 style={useStyles.title}>Hi, I'm Cindy Ding!</h1>
            {/* <IconButton onClick={this.toGitHub}> */}
            <IconButton style={useStyles.subheadings}>
              <GitHubIcon />
            </IconButton>
        </div>
      );
    }
  }

export default withRouter(Home);
